import { Fragment, useEffect, useState } from "react";
import NewsCard from "./layout/NewsCard";
import Card from "./UI/Card";
function Home() {
  const [data, setData] = useState([]);
  async function getData() {
    const response = await fetch(
      "https://api.nytimes.com/svc/topstories/v2/world.json?api-key=9fw5bZorW3brppppfa95DpFlAAKfIQkE"
    );
    if (!response.ok) {
      return;
    }
    const responseData = await response.json();
    const resultList = await responseData.results;
    setData(resultList);
  }
  useEffect(() => {
    getData();
  }, [getData]);

  return (
    <Fragment>
      {data.map((e) => {
        return (
          <Card>
            <NewsCard key={e.subsection} title={e.title} desc={e.abstract} by={e.byline} imgUrl={e.multimedia[0].url}/>
          </Card>
        );
      })}
    </Fragment>
  );
}

export default Home;
